(557,557,549585,'In the USA, Big Tobacco freely undertakes \"anti-litering\" activities and contributes to electoral campaigns.','US does not have a  comprehensive ban on tobacco sponsorships and so-called CSR. ','Action on Smoking and Health (ASH)',NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
(558,558,7450,'In Uganda,  a tobacco-funded entity, Elimination of Child Labour in Tobacco Growing Foundation (ECLT),  funds so-called CSR, furthering tobacco company interests, including in tobacco growing communities.\n','In Uganda, the Tobacco Control Act bans so-called tobacco CSR and prohibits government officials from endorsing or accepting tobacco related CSR activities. ','African Tobacco Control Alliance (ATCA)',NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
(559,559,125760,'In Ukraine, despite tobacco restrictions and unprecedented circumstances, tobacco companies manage to conduct so-called CSR activities. ','Ukraine has a comprehensive ban on tobacco sponsorships including so-called CSR but more can be done to hold the tobacco industry to account for environment harms.',NULL,NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
(560,560,4413,'In UAE, government regulation and monitoring will be important to understand how so-called CSR of the tobacco industry aggravates the harms caused.',NULL,NULL,NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
(561,561,124908,'In the U.K. the tobacco industry promoted its \"CSR activities among parliamentarians using informal parliamentary groups and direct lobbying. \"','UK does not have a comprehensive ban on tobacco sponsorships',NULL,NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
(562,562,5423,'In Uruguay, tobacco-related CSR activities are prohibited.','Uruguay has a  ban on tobacco industry’s sponsorship activities, but more can be done to hold tobacco industry to account for environmental harms, such as increasing tobacco taxes.','CIET Uruguay',NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
(563,563,27447,'In Uzbekistan, government regulation and monitoring will be important to understand how so-called CSR of the tobacco industry aggravates the harms caused.',NULL,NULL,NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
(564,564,300,'In Vanuata, government regulation and monitoring will be important to understand how so-called CSR of the tobacco industry aggravates the harms caused.',NULL,NULL,NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
(565,565,19889,'In Venezuela, despite the ban on tobacco\'s so-called CSR activities, tobacco companies continue to conduct such activities, such as  the BAT foundation’s educational programs','The Venezuelan government has implemented a thorough and complete ban on all forms of tobacco industry’s CSR activities.',NULL,NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
(566,566,112575,'In Vietnam, the tobacco industry conducts CSR activities through donations to schools, construction of houses, loans to women, among others.','Vietnam does not have a  ban on tobacco sponsorships but bars the tobacco companies/ industry from publicizing their activities .',NULL,NULL,'2022-05-02 07:04:42','2022-05-02 07:04:42'),
